import ExpenseItem from "./ExpenseItem";
import ExpenseDate from "./ExpenseDate";
import items from "../items";

function Expenses(props) {
  return items.map((expense) => {
    return (
      <ExpenseItem
        date={expense.date}
        title={expense.title}
        amount={expense.amount}
      />
    );
  });
}

export default Expenses;
